INSERT INTO `oc_information_description` (`information_id`, `language_id`, `title`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(6, 4, 'Delivery Information', '&lt;p&gt;\r\n	コンテンツが更新中です。&lt;/p&gt;\r\n', 'Delivery Information', '', ''),
(6, 1, 'Delivery Information', '&lt;p&gt;\r\n	Delivery Information&lt;/p&gt;\r\n', 'Delivery Information', '', ''),
(3, 4, 'プライバシーポリシー', '&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;h1 style=&quot;text-align: center; font-family: &amp;quot;Open Sans&amp;quot;, sans-serif;&quot;&gt;&lt;font color=&quot;#424242&quot;&gt;プライバシーポリシー&lt;/font&gt;&lt;/h1&gt;\r\n&lt;p style=&quot;font-family: &amp;quot;Open Sans&amp;quot;, sans-serif;&quot;&gt;&lt;font color=&quot;#424242&quot;&gt;&lt;br&gt;&lt;/font&gt;&lt;/p&gt;\r\n&lt;h2 class=&quot;tit-cmn-lv1&quot;&gt;&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;font color=&quot;#424242&quot;&gt;個人情報保護方針&lt;/font&gt;&lt;/span&gt;&lt;/h2&gt;&lt;font color=&quot;#424242&quot;&gt;\r\n\r\n株式会社LOOP（以下「当社」といいます。）は、個人情報保護の重要性を認識し、適切な管理を行うことが社会的責務であると考えております。当社は、個人情報保護に関係する法令等を遵守するとともに、以下個人情報保護方針に基づき社会の信頼に応えるよう努めます。&lt;/font&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;&lt;br&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(66, 66, 66); font-family: inherit; font-size: 24px;&quot;&gt;個人情報の取り扱いについて&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;b style=&quot;font-size: 18px; color: rgb(66, 66, 66); font-family: inherit;&quot;&gt;1. 法令遵守について&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;section class=&quot;sec-cmn-lv2&quot;&gt;&lt;font color=&quot;#424242&quot;&gt;当社は、個人情報に関する法令およびその他規範を遵守します。&lt;/font&gt;&lt;/section&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;h2&gt;&lt;font color=&quot;#424242&quot;&gt;&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;&lt;b&gt;2. 利用目的について&lt;/b&gt;&lt;/span&gt;\r\n&lt;/span&gt;&lt;/font&gt;&lt;/h2&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;section class=&quot;sec-cmn-lv2&quot;&gt;&lt;font color=&quot;#424242&quot;&gt;    当社は、個人情報を適法かつ公正な手段により取得します。取得する際は、収集・利用目的を明確にし、その目的の範囲内において事業の用に供します。\r\n&lt;/font&gt;&lt;/section&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;h2&gt;&lt;font color=&quot;#424242&quot;&gt;&lt;span style=&quot;font-size: 24px;&quot;&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;&lt;b&gt;3. 安全対策について&lt;/b&gt;&lt;/span&gt;\r\n&lt;/span&gt;&lt;/font&gt;&lt;/h2&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;section class=&quot;sec-cmn-lv2&quot;&gt;&lt;font color=&quot;#424242&quot;&gt;    当社は、個人情報の安全性や正確性を確保すべく、適切な安全管理措置を講じます。 個人情報を不正なアクセスや漏洩などから継続的に守るよう努め、社員の教育・啓発を実行します。&lt;/font&gt;&lt;/section&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;section class=&quot;sec-cmn-lv2&quot;&gt;&lt;span style=&quot;font-family: inherit; font-size: 18px;&quot;&gt;&lt;font color=&quot;#424242&quot;&gt;&lt;b&gt;4. 第三者提供について&lt;/b&gt;&lt;/font&gt;&lt;/span&gt;&lt;/section&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;section class=&quot;sec-cmn-lv2&quot;&gt;&lt;font color=&quot;#424242&quot;&gt;当社は、下記の場合を除き、ご本人の同意を得ることなく個人情報を第三者に開示または提供しません。開示または提供する場合は、個人情報の適切な保護のための措置が、相手方で確保されるよう努めます。&lt;br&gt;&lt;/font&gt;&lt;/section&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;section class=&quot;sec-cmn-lv2&quot;&gt;&lt;font color=&quot;#424242&quot;&gt;(1). 業務委託先またはグループ企業が業務上必要な範囲内でのみ利用する場合&lt;/font&gt;&lt;/section&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;section class=&quot;sec-cmn-lv2&quot;&gt;&lt;font color=&quot;#424242&quot;&gt;(2). 法令等に従って提供が求められた場合、あるいは許容される場合&lt;/font&gt;&lt;/section&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;h2&gt;&lt;font color=&quot;#424242&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;5. 開示・訂正・削除について&lt;/span&gt;\r\n&lt;/b&gt;&lt;/font&gt;&lt;/h2&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;section class=&quot;sec-cmn-lv2&quot;&gt;&lt;font color=&quot;#424242&quot;&gt;社は、その保有する個人情報について、ご本人から&lt;/font&gt;&lt;span style=&quot;color: rgb(66, 66, 66);&quot;&gt;&amp;nbsp;開示・訂正・削除等のご要請があった場合は、当該ご請求がご本人によるものであることが確認できた後に、合理的な期間内にこれに対応します。&lt;/span&gt;&lt;/section&gt;\r\n&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;&lt;br&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;株式会社 ＬＯＯＰ&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;〒566-0062 大阪府摂津市鳥飼上&lt;/font&gt;&lt;span style=&quot;color: rgb(66, 66, 66); font-family: &amp;quot;Century Gothic&amp;quot;, Calibri, Arial, sans-serif, &amp;quot;ヒラギノ角ゴ Pro W3&amp;quot;, &amp;quot;Hiragino Kaku Gothic Pro&amp;quot;, メイリオ, Meiryo, &amp;quot;ＭＳ Ｐゴシック&amp;quot;;&quot;&gt;５－２－２1&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;font color=&quot;#424242&quot;&gt;店舗責任者:　佐保井　猛&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;', 'プライバシーポリシー', '', ''),
(3, 1, 'Privacy Policy', '&lt;h1 style=&quot;text-align: center; &quot;&gt;プライバシーポリシー&lt;/h1&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;個人情報保護方針&lt;/p&gt;&lt;p&gt;株式会社LOOP（以下「当社」といいます。）は、個人情報保護の重要性を認識し、適切な管理を行うことが社会的責務であると考えております。当社は、個人情報保護に関係する法令等を遵守するとともに、以下個人情報保護方針に基づき社会の信頼に応えるよう努めます。&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;h4&gt;個人情報の取り扱いについて&lt;/h4&gt;&lt;p&gt;法令遵守について&lt;/p&gt;&lt;p&gt;当社は、個人情報に関する法令およびその他規範を遵守します。&lt;/p&gt;&lt;p&gt;利用目的について&lt;/p&gt;&lt;p&gt;当社は、個人情報を適法かつ公正な手段により取得します。取得する際は、収集・利用目的を明確にし、その目的の範囲内において事業の用に供します。&lt;/p&gt;&lt;p&gt;安全対策について&lt;/p&gt;&lt;p&gt;当社は、個人情報の安全性や正確性を確保すべく、適切な安全管理措置を講じます。 個人情報を不正なアクセスや漏洩などから継続的に守るよう努め、社員の教育・啓発を実行します。&lt;/p&gt;&lt;p&gt;第三者提供について&lt;/p&gt;&lt;p&gt;&amp;nbsp;当社は、下記の場合を除き、ご本人の同意を得ることなく個人情報を第三者に開示または提供しません。開示または提供する場合は、個人情報の適切な保護のための措置が、相手方で確保されるよう努めます。&lt;/p&gt;&lt;p&gt;（1）.　業務委託先またはグループ企業が業務上必要な範囲内でのみ利用する場合&lt;/p&gt;&lt;p&gt;（2）.　法令等に従って提供が求められた場合、あるいは許容される場合&lt;/p&gt;&lt;p&gt;開示・訂正・削除について&lt;/p&gt;&lt;p&gt;社は、その保有する個人情報について、ご本人から開示・訂正・削除等のご要請があった場合は、当該ご請求がご本人によるものであることが確認できた後に、合理的な期間内にこれに対応します。&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;株式会社ＬＯＯＰ&lt;/p&gt;&lt;p&gt;〒566-0062 大阪府摂津市鳥飼上５－２－２１&lt;/p&gt;&lt;p&gt;店舗責任者:　佐保井　猛&lt;/p&gt;\r\n', 'Privacy Policy', '', ''),
(21, 1, 'Add some stylish design', '&lt;p&gt;コンテンツが更新中です。&lt;br&gt;&lt;/p&gt;', 'Add some stylish design', '', ''),
(21, 4, 'Add some stylish design', '&lt;p&gt;コンテンツが更新中です。&lt;br&gt;&lt;/p&gt;', 'Add some stylish design', '', ''),
