mal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;＜変更事項＞マイページ上で退会可能であるため、窓口への連絡は不要となります。&lt;/span&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt; &lt;/span&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;2. &lt;/span&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;会員が退会を行った場合でも、注文済みでお受け取りいただいていない商品がある場合は、商品の配送を行います。また、配送に伴い配送の案内の&lt;/span&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;E&lt;/span&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;メールを送信します。&lt;/span&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt; &lt;/span&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;3. &lt;/span&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;当社は退会後も、一定期間内は退会した会員の情報を保存する場合があります。&lt;/span&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt; &lt;/span&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span style=&quot;fon