&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;b&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;第&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;10&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;条&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt; [&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;会員が利用できるサービス&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;]&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;会員は、商品の閲覧、商品の購入、購入履歴閲覧、レビュー登録・閲覧、お気に入りリスト登録・閲覧等のサービスを受けることができます&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;b&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: &amp;quot;Yu Mincho&amp;quot;, serif;&quot;&gt;第&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size: 11pt; font-family: &amp;quot;Yu Mincho&amp;quot;, serif;&quot;&gt;11&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: &amp;quot;Yu Mincho&amp;quot;, serif;&quot;&gt;条&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size: 11pt; font-family: &amp;quot;Yu Mincho&amp;quot;, serif;&quot;&gt; [&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: &amp;quot;Yu Mincho&amp;quot;, serif;&quot;&gt;会員以外が利用できるサービス&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size: 11pt; font-family: &amp;quot;Yu Mincho&amp;quot;, serif;&quot;&gt;]&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;\r\n\r\n&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: &amp;quot;Yu Mincho&amp;quot;, serif;&quot;&gt;会員以外の利用者は、商品の閲覧等のサービスを受けることができます。&lt;/span&gt;&lt;span style=&quot;font-size: 11pt; font-family: &amp;quot;Yu Mincho&amp;quot;, serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;b&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 16pt; font-family: 游明朝, serif;&quot;&gt;第&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size: 16pt; font-family: 游明朝, serif;&quot;&gt;4&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 16pt; font-family: 游明朝, serif;&quot;&gt;章&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 16pt; font-family: 游明朝, serif;&quot;&gt; &lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 16pt; font-family: 游明朝, serif;&quot;&gt;商品購入&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size: 16pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;b&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;第&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;12&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;条&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt; [&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;商品の購入&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;]&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;1. &lt;/span&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;会員は、本サービスを利用して当社から商品等を購入することができます。&lt;/span&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt; &lt;/span&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;2. &lt;/span&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;会員は、商品等の購入に際して、当社が