erif;&quot;&gt;5. &lt;/span&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;本サイトから他のウェブサイト若しくはリソースへのリンク、又は第三者のウェブサイト若しくはリソースから本サイトへのリンクを提供している場合、当社は、当該リンク先の内容、利用及びその結果については、いかなる責任も負わないものとします。（目的適合性、機能性、正確性、確実性、最新性及び完全性を含みますが、これらに限りません。）なお、当社は、リンク先のウェブサイト又はリソースの内容が、違法又は本サイトの管理・運営上不適切であると合理的に判断した場合には、会員に何らの通知を要することなく、当該リンク先を削除することができるものとします。&lt;/span&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt; &lt;/span&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;6. &lt;/span&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;本サイトに掲載されている情報、画像およびリンク等を利用することにより、利用者の機器等に損害が発生した場合、またはウイルスに感染した場合等について、当社はいかなる責任も負いません。&lt;/span&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt; &lt;/span&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;7. &lt;/span&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;当社は、以下の各号の場合に、一時的に本サービスが停止、中止又は変更されたとしても、会員が直接的又は間接的に被った一切の損害、損失、不利益等について、いかなる責任も負わないものとします。&lt;/span&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;(1) &lt;/span&gt