quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;(1) &lt;/span&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;当該情報が当社もしくは第三者の著作権その他の権利を侵害し、又は当社もしくは第三者の名誉もしくは信用を毀損していると認められる場合&lt;/span&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;(2) &lt;/span&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;当該情報が第三者の著作権その他の権利を侵害し、又は第三者の名誉もしくは信用を毀損しているとの警告を当社が当該第三者から受け取った場合&lt;/span&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;(3) &lt;/span&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;日本又は適用ある外国の法令に違反していると認められる場合&lt;/span&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;(4) &lt;/span&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;法令上の根拠に基づき官公庁、公的機関から削除するよう命令を受けた場合&lt;/span&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;(5) &lt;/span&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;その他本サイトの運営にとって不適切と認められる場合&lt;/span&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;2. &lt;/span&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;当社は、当社の判断で、利用者に何らの通知をすることなく、利用者が本サイトの全部又はその一部にアクセスすることを拒否することができるものとします。&lt;/span&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;b&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;第&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;28&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;条&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt; [&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;識別情報の取得&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;]&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;1.&lt;/span&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;当社は、会員がオンラインショップ、その他当社のホームページ等を再度訪問した場合に、閲覧その他本サービスの利便性向上、広告の配信、統計データの取得等のため、会員が使用するコンピューター、携帯電話、及びスマートフォン等の情報端末を識別するクッキー及び個体識別情報（以下、総称して「クッキー」といいます）と呼ばれるデータを送付し、ハードディスクに記録するものとします。当社は、取得したクッキーを会員の情報と合わせて、当社の利用目的の達成に必要な範囲内で利用するものとします。&lt;/span&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt; &lt;/span&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;2. &lt;/span&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;会員は、自ら使用するブラウザ等のインターネット閲覧ソフトの設定を変更することにより、オンラインショップ、その他当社のホームページ等から送付されるクッキーの受領を拒否することができるものとします。ただし、クッキーの受領を拒否することにより、本サービスが正常に利用できない場合があることを会員は予め了承するものとします。&lt;/span&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt; &lt;/span&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;3. &lt;/span&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;当社は、会員がオンラインショップ、その他当社のホームページにアクセスしたことについて、その操作の情報（以下「アクセスログ」といいます）を記録するものとします。当社は、アクセスログを会員の情報と合わせて、本サービスの向上のため、当社の利用目的達成の範囲で利用するとともに、本サービスに問題が発生した際の原因追及、利用状況に関する統計・分析処理等に利用するものとします。&lt;/span&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;(1) &lt;/span&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;利用者が本サービスのサーバーにアクセスする際の&lt;/span&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;IP&lt;/span&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;アドレス又は携帯端末の機体識別番号に関する情報&lt;/span&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;(2) &lt;/span&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;当社が、クッキーの技術（&lt;/span&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;Web&lt;/span&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;ブラウザを通じて利用者のコンピュータに一時的にデータを書き込んで会員が最後にサイトを訪れた日時、そのサイトの訪問回数等を記録保存する技術をいいます。）を通じて取得する利用者のアクセス情報&lt;/span&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;b&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;第&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;29&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;条&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt; [&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;地位の譲渡&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;]&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;当社は、本サービスに係る事業を譲渡（通常の事業譲渡の他、会社分割等その他事業が移転する場合を含みますがこれらに限りません）した場合、当該事業譲渡に伴い本規約上の会員の地位、本規約に基づく権利及び義務並びに会員の登録事項その他の会員に関する一切の情報を当該事業譲渡の譲受人に対し譲渡することができるものとし、会員は、かかる譲渡について予め同意するものとします。&lt;/span&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;b&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;第&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;30&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;条&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt; [&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;分離可能性&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;]&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;本規約のいずれかの規定又はその一部が、消費者契約法その他の法令等により無効又は執行不能と判断された場合であっても、無効又は執行不能と判断された規定又は一部の残りの部分は、継続して完全に効力を有するものとします。&lt;/span&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;b&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;第&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;31&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;条&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt; [&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;準拠法、管轄&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;]&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;本規約は日本法に基づき解釈されるものとし、本サービスまたは本規約に関する紛争については、当社本店所在地を管轄する地方裁判所を第一審の専属的合意管轄裁判所とします。&lt;/span&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;b&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;第&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;32&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;条&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt; [&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;利用料&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;]&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;本サービスの利用にあたり、本サービスへの接続にかかる費用、メール配信を受け取るための費用は、利用者のご負担となります。&lt;/span&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;b&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;第&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;33&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;条&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt; [&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;協議&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;]&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal&quot;&gt;&lt;span lang=&quot;JA&quot; style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;本サイトに関連して利用者と当社との間で問題が生じた場合には、利用者と当社で誠意をもって協議するものとします。&lt;/span&gt;&lt;span style=&quot;font-size: 11pt; font-family: 游明朝, serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;', 'ご利用規約', '', '');
