(6, 1, 'The Affordable Outfit Game-Changers You Can Take Into Any Season', '', '&lt;p&gt;Obsessed with these dainty layers! This necklace I layer with everything.&lt;br&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;These earrings are a great delicate but statement piece. They look so pretty with casual outfits and gorgeous paired with an off the shoulder dress or top for date night.&lt;/p&gt;\r\n\r\n&lt;p&gt;You donâ€™t realize it, but jewelry can completely transform your outfit. Even such a simple detail can be a total game-changer! Iâ€™m always on the go, and between trying to get the kids ready and in the car, honestly sometimes itâ€™s enough of a feat to get dressed and out the door with a bag and shoes haha. Iâ€™ve learned to keep a lot of my jewelry in my car so instead of an afterthought itâ€™s become more of a habit to finish accessorizing in the car.&lt;/p&gt;\r\n\r\n&lt;p&gt;I canâ€™t get enough of dainty pieces! I think thatâ€™s probably 90% of my jewelry collection right now, from pretty stacked rings to layered chokers and necklaces â€“ they are pieces that you can wear with anything and everything. I just got these from Rocksbox â€“ itâ€™s such a great way to get a jewelry refresher for the season. Itâ€™s a membership service so you can try out new styles and different designers before you buy them.  If you havenâ€™t tried it yet, you can get your first month free with code: hellofashionxoxo if you sign up between now and October 31st. Itâ€™s also a great gift idea for the holidays coming up.&lt;/p&gt;\r\n', '', 'The Affordable Outfit Game-Changers You Can Take Into Any Season', '', ''),
(4, 1, 'The Best Street Style Blogs', '', '&lt;p&gt;We have been so spoiled here in Utah with a really warm fall, but this week itâ€™s been so cold this week (technically freezing this morning!) and Iâ€™m already over the cold.. Anyone else already thinking about planning a trip somewhere warm? Iâ€™m not ready for all the colorful leaves to disappear either! Itâ€™s my favorite part of fall. While I was shooting this the leaf-blowing truck pulled up and started blowing all the leaves away from the street â€“ I didnâ€™t know know that was a thing haha but apparently they have to do it every day during the fall since there are so many leaves falling. So itâ€™s crazy to think all these leaves are just from ONE DAY!&lt;/p&gt;\r\n&lt;p&gt;\r\nYou guys may recognize this look from when I shared it a couple weeks ago on Instagram, but honestly pics donâ€™t do the pieces justice. They are an investment but all of the pieces have so much detail â€“ they are amazing in real life. I discovered Fabiana Fillipi last year. Remember this outfit? I fell in love with their collection and they quickly became some of my favorite designers. This top is probably my favorite. I love the combination collar and itâ€™s so simple but really high quality so it can transform any outfit you pair it with. Also love the beaded hem on this trouser. Itâ€™s crazy what a difference little details make but they really do! This trench is super softer and also reversible, with a grey or camel option â€“ so pretty. Also obsessed with the detailing on this coat. Below are some more of my favorites!&lt;/p&gt;', '', 'The Best Street', '', ''),
(4, 2, 'The Best Street Style Blogs', '', '&lt;p&gt;We have been so spoiled here in Utah with a really warm fall, but this week itâ€™s been so cold this week (technically freezing this morning!) and Iâ€™m already over the cold.. Anyone else already thinking about planning a trip somewhere warm? Iâ€™m not ready for all the colorful leaves to disappear either! Itâ€™s my favorite part of fall. While I was shooting this the leaf-blowing truck pulled up and started blowing all the leaves away from the street â€“ I didnâ€™t know know that was a thing haha but apparently they have to do it every day during the fall since there are so many leaves falling. So itâ€™s crazy to think all these leaves are just from ONE DAY!&lt;/p&gt;\r\n&lt;p&gt;\r\nYou guys may recognize this look from when I shared it a couple weeks ago on Instagram, but honestly pics donâ€™t do the pieces justice. They are an investment but all of the pieces have so much detail â€“ they are amazing in real life. I discovered Fabiana Fillipi last year. Remember this outfit? I fell in love with their collection and they quickly became some of my favorite designers. This top is probably my favorite. I love the combination collar and itâ€™s so simple but really high quality so it can transform any outfit you pair it with. Also love the beaded hem on this trouser. Itâ€™s crazy what a difference little details make but they really do! This trench is super softer and also reversible, with a grey or camel option â€“ so pretty. Also obsessed with the detailing on this coat. Below are some more of my favorites!&lt;/p&gt;', '', 'The Best Street', '', ''),
(5, 2, 'Jewel Tone Velvet Linens for Fall and Winter Weddings', '', '&lt;p&gt;Thereâ€™s that special something in the air letting us know, Fall is right around the corner and Winter is coming right after! Weâ€™re ready to feel the temperatures drop and the indoors get extra cozy! To be honest, we love this time of year when it comes to designing weddings and events!&lt;/p&gt;\r\nWith that in mind, we are feeling gemstones, jewel tones and the soft touch of velvet for this wedding\r\nseason. Last winter we were all about Marsala, this year we are going the whole assortment of colors!\r\n&lt;p&gt;\r\nFor those looking to lighten up, we found the perfect shade of Turquoise for the fall. Itâ€™s deep enough to sparkle like an Aquamarine and bright enough to warm us up too!\r\nPaired with our natural wood Verona Chairs, the Turquoise Velluto has a rustic sensibility to it perfect for an outdoor fall wedding. Give it even more of a boho bride style by adding in pretty pink accents like these raw crystals. With floating candles and the softest touch of blush blooms, the Velluto fabric sets a perfect canvas for this design. Just like this setting, itâ€™s a great way to bring cool fall feels to a tropical setting!&lt;/p&gt;&lt;p&gt;\r\n\r\nNow, for those looking to go all in on fall colors, we love a deep Ruby red like our Wine Velluto. It sets the mood for a lively holiday feast or a romantic wedding reception.\r\n\r\nPaired with our French country-inspired linen Maison Dining Chairs, this color palette creates a rich\r\natmosphere for dinner guests, especially when set against beautiful blooming Bougainvillea!\r\n\r\nBring in more of those gorgeous jewel tones in purples and oranges across the tabletop and use copper toned accents to tie the look together!\r\n\r\nSo whatever your event is this season, bring in those fall feelings with an array of gemstone-hued linens in soft velvet-inspired fabrics to really amp up the party. Trust us, we know how to host a good one!\r\n\r\nPhotography Katie Lopez Photography | Florals Petal Productions | Tabletop Pieces Anthropologie | Chargers, Linens and Napkins, Chairs and Tables Nuage Designs\r\n&lt;/p&gt;', '', 'Jewel tones', '', ''),
